import React from 'react';

// Composant pour afficher le tableau des tickets
const TicketTable = ({ tickets }) => {
  return (
    <div style={{ padding: '20px', backgroundColor: '#f9f9f9', borderRadius: '8px' }}>
      <h2 style={{ textAlign: 'center', color: '#333' }}>Tableau des Tickets</h2>
      <table style={{ width: '100%', borderCollapse: 'collapse', marginTop: '20px' }}>
        <thead style={{ backgroundColor: '#007BFF', color: '#fff' }}>
          <tr>
            <th style={{ padding: '10px', textAlign: 'left' }}>ID Ticket</th>
            <th style={{ padding: '10px', textAlign: 'left' }}>Client</th>
            <th style={{ padding: '10px', textAlign: 'left' }}>Type de Demande</th>
            <th style={{ padding: '10px', textAlign: 'left' }}>Statut</th>
            <th style={{ padding: '10px', textAlign: 'left' }}>Date de Création</th>
            <th style={{ padding: '10px', textAlign: 'left' }}>Date d'Échéance</th>
            <th style={{ padding: '10px', textAlign: 'left' }}>Actions</th>
          </tr>
        </thead>
        <tbody>
          {tickets.map((ticket) => (
            <tr key={ticket.id} style={{ borderBottom: '1px solid #ddd' }}>
              <td style={{ padding: '8px' }}>{ticket.id}</td>
              <td style={{ padding: '8px' }}>{ticket.client}</td>
              <td style={{ padding: '8px' }}>{ticket.type}</td>
              <td style={{ padding: '8px' }}>{ticket.status}</td>
              <td style={{ padding: '8px' }}>{ticket.creationDate}</td>
              <td style={{ padding: '8px' }}>{ticket.dueDate}</td>
              <td style={{ padding: '8px' }}>
                <button style={{ marginRight: '10px', padding: '5px 10px', backgroundColor: '#28a745', color: '#fff', border: 'none', borderRadius: '4px' }}>
                  Voir
                </button>
                <button style={{ marginRight: '10px', padding: '5px 10px', backgroundColor: '#ffc107', color: '#fff', border: 'none', borderRadius: '4px' }}>
                  Modifier
                </button>
                <button style={{ padding: '5px 10px', backgroundColor: '#dc3545', color: '#fff', border: 'none', borderRadius: '4px' }}>
                  Fermer
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

// Exemple de données des tickets
const tickets = [
  { id: 1, client: 'Client A', type: 'Retrait', status: 'En cours', creationDate: '2025-04-20', dueDate: '2025-04-22' },
  { id: 2, client: 'Client B', type: 'Dépôt', status: 'Terminé', creationDate: '2025-04-21', dueDate: '2025-04-23' },
  { id: 3, client: 'Client C', type: 'Consultation', status: 'En attente', creationDate: '2025-04-22', dueDate: '2025-04-24' },
];

// Composant principal de l'application
const App = () => {
  return <TicketTable tickets={tickets} />;
};

export default App;
